def rocky_robot_head_sad_frames(is_animated):

    frames = []

    materials = {}

    image = PIL.Image.open('images/rocky_robot_head_sad_01.png')
    image = image.tobytes('raw', 'RGBX', 0, -1)
    texture_id = glGenTextures(1)
    glBindTexture(GL_TEXTURE_2D, texture_id)
